// Filter applies the FeatureWhereInput filter on the FeatureQuery builder.
func (i *FeatureWhereInput) Filter(q *FeatureQuery) (*FeatureQuery, error) {
	if i == nil {
		return q, nil
	}
	p, err := i.P()
	if err != nil {
		if err == ErrEmptyFeatureWhereInput {
			return q, nil
		}
		return nil, err
	}
	return q.Where(p), nil
}

